/*Table structure for table `m_currency` */

DROP TABLE IF EXISTS `m_currency`;

CREATE TABLE `m_currency` (
  `currencyId` int(11) NOT NULL AUTO_INCREMENT,
  `currencyCode` varchar(10) DEFAULT NULL,
  `currencyName` varchar(50) DEFAULT NULL,
  `interNationalCode` varchar(45) DEFAULT NULL,
  `interNationalName` varchar(45) DEFAULT NULL,
  `decimalUnit` varchar(45) DEFAULT NULL,
  `currencySymbol` varchar(45) DEFAULT NULL,
  `userId` int(11) DEFAULT NULL,
  `transDate` datetime DEFAULT CURRENT_TIMESTAMP,
  `isApproved` varchar(45) DEFAULT '0',
  `approvedUserId` int(11) DEFAULT '0',
  `approvedDateTime` datetime DEFAULT NULL,
  `isDeleted` int(11) DEFAULT '0',
  `deleteDateTime` datetime DEFAULT NULL,
  `deleteUserId` int(11) DEFAULT '0',
  `updateCount` int(11) DEFAULT '0',
  `lastUpdateUserId` int(11) DEFAULT '0',
  `isActive` tinyint(1) DEFAULT '0',
  `activateDateTime` datetime DEFAULT NULL,
  `activateUserId` int(11) DEFAULT '0',
  PRIMARY KEY (`currencyId`)
) ENGINE=InnoDB AUTO_INCREMENT=187 DEFAULT CHARSET=utf8mb4;

