  `itemImagesUrl` varchar(2000) DEFAULT NULL,
  `itemStatus` varchar(20) DEFAULT NULL,
  `internalItemCode` varchar(20) DEFAULT NULL,
  `isApproved` int(11) DEFAULT '0',
  `userId` int(11) DEFAULT NULL,
  `isDeleted` int(11) DEFAULT '0',
  `userAction` varchar(20) DEFAULT NULL,
  `transDate` datetime DEFAULT CURRENT_TIMESTAMP,
  `isActive` tinyint(1) DEFAULT '0',
  `subitemtypefieldOptionType` varchar(1000) DEFAULT NULL,
  `subitemtypefieldOptionValues` varchar(5000) DEFAULT NULL,
  `itemBarCodeNo` varchar(20) DEFAULT NULL,
  `itemName` varchar(50) DEFAULT NULL,
