  `rackId` int(11) DEFAULT '0',
  `racknumberId` int(11) DEFAULT '0',
  `storelocationId` int(11) DEFAULT '0',
  `storelocationCode` varchar(50) DEFAULT NULL,
  `designerURL` varchar(200) DEFAULT NULL,
  `cellId` int(11) DEFAULT NULL,
  PRIMARY KEY (`logId`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8mb4;

