/*Table structure for table `m_language` */

DROP TABLE IF EXISTS `m_language`;

CREATE TABLE `m_language` (
  `languageId` int(11) NOT NULL AUTO_INCREMENT,
  `languageName` varchar(100) DEFAULT NULL,
  `userId` int(11) DEFAULT NULL,
  `transDate` datetime DEFAULT CURRENT_TIMESTAMP,
  `isApproved` int(11) DEFAULT '0',
  `approvedUserId` int(11) DEFAULT '0',
  `approvedDateTime` datetime DEFAULT NULL,
  `isDeleted` int(11) DEFAULT '0',
  `deleteDateTime` datetime DEFAULT NULL,
  `deleteUserId` int(11) DEFAULT '0',
  `updateCount` int(11) DEFAULT '0',
  `lastUpdateUserId` int(11) DEFAULT '0',
  `isActive` tinyint(1) DEFAULT '0',
  `activateDateTime` datetime DEFAULT NULL,
  `activateUserId` int(11) DEFAULT '0',
  PRIMARY KEY (`languageId`)
) ENGINE=InnoDB AUTO_INCREMENT=130 DEFAULT CHARSET=utf8mb4;

