/*Table structure for table `t_companyaddress` */

DROP TABLE IF EXISTS `t_companyaddress`;

CREATE TABLE `t_companyaddress` (
  `companyAddressId` int(11) NOT NULL AUTO_INCREMENT,
  `companyId` int(11) DEFAULT NULL,
  `contactPerson` varchar(200) DEFAULT NULL,
  `houseBuildingNo` varchar(100) DEFAULT NULL,
  `street1` varchar(100) DEFAULT NULL,
  `street2` varchar(100) DEFAULT NULL,
  `landmark` varchar(100) DEFAULT NULL,
  `countryId` int(11) DEFAULT NULL,
  `stateId` int(11) DEFAULT NULL,
  `cityId` int(11) DEFAULT NULL,
  `areaId` int(11) DEFAULT NULL,
  `pincode` varchar(15) DEFAULT NULL,
  `mobileNumber` varchar(15) DEFAULT NULL,
  `altMobileNumber` varchar(15) DEFAULT NULL,
  `telephoneNumber` varchar(10) DEFAULT NULL,
  `landLineNumber` varchar(20) DEFAULT NULL,
  `faxNumber` varchar(20) DEFAULT NULL,
  `website` varchar(100) DEFAULT NULL,
  `emailId` varchar(50) DEFAULT NULL,
  `category` varchar(50) DEFAULT NULL,
  `userId` int(11) DEFAULT NULL,
  `transDate` datetime DEFAULT CURRENT_TIMESTAMP,
  `isApproved` int(11) DEFAULT '0',
  `approvedUserId` int(11) DEFAULT '0',
  `approvedDateTime` datetime DEFAULT NULL,
  `isDeleted` int(11) DEFAULT '0',
  `deleteDateTime` datetime DEFAULT NULL,
  `deleteUserId` int(11) DEFAULT '0',
  `updateCount` int(11) DEFAULT '0',
  `lastUpdateUserId` int(11) DEFAULT '0',
  `isActive` tinyint(1) DEFAULT '0',
  `activateDateTime` datetime DEFAULT NULL,
  `activateUserId` int(11) DEFAULT '0',
  PRIMARY KEY (`companyAddressId`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;

