/* Procedure structure for procedure `proc_approve_m_area_Status` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_approve_m_area_Status` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_approve_m_area_Status`(Area_Id int,
User_Id int, out error1 int)
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare Area_Status varchar(10);
set Area_Status=(select trim(isApproved) from m_area where areaId=trim(Area_Id) and isDeleted=0);

INSERT INTO m_area_log(areaId,countryId,stateId,cityId,areaName,isDeleted,isApproved,userId,userAction,transDate)
SELECT areaId,countryId,stateId,cityId,areaName,isDeleted,isApproved,userId,'approve',transDate FROM m_area where areaId=trim(Area_Id);

IF Area_Status = 1 THEN
update m_area set isApproved=0,approvedDateTime=now(),approvedUserId=trim(User_Id)  where areaId=trim(Area_Id);
else
update m_area set isApproved=1,approvedDateTime=now(),approvedUserId=trim(User_Id)  where areaId=trim(Area_Id);
END IF;
set error1=0;

end;

  COMMIT;
END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_approve_m_bank_Status` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_approve_m_bank_Status` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_approve_m_bank_Status`(Bank_Id int,
User_Id int,
 out error1 int)
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare Bank_Status varchar(10);
set Bank_Status=(select trim(isApproved) from m_bank where bankId=trim(Bank_Id) and isDeleted=0);

INSERT INTO m_bank_log(bankId,bankCode,bankName,BankAmount,isDeleted,isApproved,userId,userAction,transDate)
