BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare Department_Status varchar(10);
set Department_Status=(select trim(isApproved) from u_department where departmentId=trim(Department_Id) and isDeleted=0);

INSERT INTO u_department_log(departmentId,departmentName,departmentDescription,isDeleted,isApproved,userId,userAction,transDate)
SELECT departmentId,departmentName,departmentDescription,isDeleted,isApproved,userId,'approve',transDate FROM u_department where departmentId=trim(Department_Id);

IF Department_Status = 1 THEN
update u_department set isApproved=0,approvedDateTime=now(),approvedUserId=trim(User_Id)  where departmentId=trim(Department_Id);
else
update u_department set isApproved=1,approvedDateTime=now(),approvedUserId=trim(User_Id)  where departmentId=trim(Department_Id);
END IF;
set error1=0;

end;

  COMMIT;
END */$$
