/* Procedure structure for procedure `proc_get_item_code_genration` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_get_item_code_genration` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_get_item_code_genration`(
Item_Type_id int,out strout varchar(50))
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare Item_type varchar(50);
declare Item_Id varchar(50);
declare Item_Id1 int;
declare count int;
set Item_type=(Select REPLACE(itemTypeName,' ','') as item from m_itemtype where itemTypeId=Item_Type_id);
set Item_Id1=(select (itemCodestring) from m_item ORDER BY itemId DESC LIMIT 1) ;
if(Item_Id1 is null)then
set Item_Id='0000001';
else
set count=(select length(itemCodestring+1) from m_item ORDER BY itemId DESC LIMIT 1);
CASE count
		WHEN  1 THEN
		   SET Item_Id = concat(' 000000',(Item_Id1+1));
		WHEN 2 THEN
		   SET Item_Id = concat(' 00000',(Item_Id1+1));
           WHEN 3 THEN
		   SET Item_Id = concat(' 0000',(Item_Id1+1));
		  WHEN 4 THEN
		   SET Item_Id = concat(' 000',(Item_Id1+1));
           WHEN 5 THEN
		   SET Item_Id = concat(' 00',(Item_Id1+1));
           WHEN 6 THEN
		   SET Item_Id = concat(' 0',(Item_Id1+1));
           WHEN 7 THEN
		   SET Item_Id =(Item_Id1+1);
	END CASE;

end if;
set strout=(select concat(concat(substring(ucase(Item_type),1,3),Item_Id),',',trim(Item_Id)) as Item_Code);
end;

  COMMIT;
END */$$
DELIMITER ;

