i.itemURLLink,i.itemCoCountryofOrigin,i.itemManufacturingPartNumber,i.itemShippingCost,i.itemContactDetails,i.itemEMail,i.itemWeChat,
i.itemWhatsApp,i.itemOtherContactType,i.itemDataSheetUrl,i.itemComplianceUrl,i.itemCADFileUrl,i.itemCertificationUrl,i.itemScrappingfromWebUrl,
i.itemImagesUrl,i.internalItemCode,i.transDate,i.subitemtypefieldUOMName,i.itemQuantity,i.storelocationCode,i.subitemtypefieldOptionValues,
(select concat(uomName,'(',uomCode, ')')  from m_uom where  uomId=i.uomId) as UOMName,
(select uomGroupName  from m_uomgroup where  uomGroupId=i.uomGroupId) as uomGroupName,
(select concat(uomName,'(',uomCode, ')')  from m_uom where  uomId=i.altUOMId) as altUOMName,
(select uomGroupName  from m_uomgroup where  uomGroupId=i.altUOMGroupId) as altuomGroupName,
(select valuationName  from m_valuation where  valuationId=i.valuationId) as valuationName,
(select  concat(manageitemName,'(',manageitemCode, ')') from m_manageitem  where  manageitemId=i.itemManageCodeId) as manageitemName,
(select subitemtypeName from m_subitemtype where  subitemtypeId=i.itemSubTypeId) as subitemName,
(select itemTypeName  from m_itemtype where itemTypeId =i.itemTypeId) as itemType,
(select currencySymbol  from m_currency where  currencyId=i.currencyId) as currencyName,
(select hscategoryName  from m_hscategory where  hscategoryId=i.hscategoryId) as hscategoryName,
(select  rackName from  m_rack where  rackId=i.rackId) as rackName,
(select  racknumberName from m_racknumber where  racknumberId=i.racknumberId) as racknumberName,
(select  storelocationName from m_storelocation where  storelocationId=i.storelocationId) as storelocationName,
(SELECT  `cellNo` FROM `m_cellno` WHERE  `cellId`=i.cellId) AS cellNumber 
 from m_item_log i where i.itemId=item_Id
 ORDER BY logId DESC LIMIT 1 ;
 
 select * from itemtemp;
end;
END */$$
DELIMITER ;

