/* Procedure structure for procedure `proc_get_m_sub_item_field_value_for_ckeck_duplicate_update` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_get_m_sub_item_field_value_for_ckeck_duplicate_update` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_get_m_sub_item_field_value_for_ckeck_duplicate_update`(
item_Id int,
sub_item_Type_Id int,
sub_item_Type_Field varchar(5000),
sub_item_Type_Field_UOM VARCHAR(2000)
)
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare id int;
declare count1 int;
set count1= (Select count(i.itemId) from  m_item i  where (i.itemSubTypeId=sub_item_Type_Id) and REPLACE(CONCAT(subitemtypefieldOptionValues,',',subitemtypefieldUOMName),' ','')=REPLACE(CONCAT(sub_item_Type_Field,',',sub_item_Type_Field_UOM),' ','') and i.isDeleted=0);
IF (count1 > 0) THEN
if(count1=1) then
set id=(Select (i.itemId) from  m_item i  where (i.itemSubTypeId=sub_item_Type_Id) and REPLACE(CONCAT(subitemtypefieldOptionValues,',',subitemtypefieldUOMName),' ','')=REPLACE(CONCAT(sub_item_Type_Field,',',sub_item_Type_Field_UOM),' ','') and i.isDeleted=0);
if(id=item_Id) then
select 0 as count1;
else
select count1;
end if; 
else
select count1;
end if ;
else
select count1;
end if;


end;
END */$$
