/* Procedure structure for procedure `proc_get_v_action_permission_acc_vendor_id` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_get_v_action_permission_acc_vendor_id` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_get_v_action_permission_acc_vendor_id`(Vendor_id int)
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
SELECT vp.permissionId,1 AS COUNT,vp.permissionName,
(CASE WHEN ap.isView= 1 THEN ap.isView ELSE vp.isView END )  AS isView FROM
 v_vendorpermission vp LEFT JOIN v_actionpermission ap ON vp.permissionId=ap.permissionId 
 WHERE (ap.vendorId=Vendor_id AND vp.isDeleted=0 AND ap.isDeleted=0)
 UNION SELECT vp.permissionId,0 AS COUNT,vp.permissionName,vp.isView  FROM v_vendorpermission vp
 WHERE vp.permissionId NOT IN (SELECT permissionId FROM v_actionpermission  WHERE vendorId=Vendor_id AND isDeleted=0 ) 
 AND  vp.isDeleted=0;

end;

  COMMIT;
