set id=(select count(projectDetailId) from e_projectdetail where   (projectId=trim(Project_Id) and PartNo=trim(Part_No) and cadfileName=trim(CAD_File_Name)) and isDeleted=0);
IF id = 0 THEN
INSERT INTO e_projectdetail(projectId,PartNo,cadfileName,catfileUrl,materialType,materialThickness,materialFinishing,cadFileType,fileFormat,userId)
 VALUES(trim(Project_Id),trim(Part_No),trim(CAD_File_Name),trim(CAD_File_URL),trim(Material_Type),trim(Material_Thickness),trim(Material_Finishing),trim(CAD_File_Type),trim(CAD_File_Format),trim(User_Id)); 
