/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_Insert_m_item`(
  UOM_Id int,
  UOM_Group_Id int,
  Valuation_Id int,
  Item_Type_Id int,
  Item_Sub_Type_Id int,
  Item_Manage_Code_Id int,
  Valuation_Method_Id int ,
  Material_Category_Id int ,
  Item_Description varchar(500) ,
  Item_Manufacture varchar(50),
  Item_Brand varchar(50),
  Supplier_Name varchar(50) ,
  Item_Price decimal(18,2),
  Item_Min_Order_Qty decimal(18,2),
  Item_Thres_hold varchar(100),
  item_HS_Code varchar(50),
  item_URL_Link varchar(500),
  Item_CoCountryof_Origin varchar(100),
  Item_Manufacturing_Part_Number varchar(50),
  Item_Shipping_Cost decimal(18,2) ,
  Item_Contact_Details varchar(20),
  Item_EMail varchar(100),
  Item_WeChat varchar(100) ,
  item_Whats_App varchar(20),
  Item_Other_Contact_Type varchar(20),
  Item_Data_Sheet_Url varchar(100),
  Item_Compliance_Url varchar(100) ,
  item_CADFile_Url varchar(100) ,
  Item_Certification_Url varchar(100) ,
  Item_Scrapping_fromWeb_Url varchar(100) ,
  Item_Images_Url varchar(2000) ,
  Item_Status varchar(20) ,
  Sub_Item_Type_Field_Option_Type varchar(1000),
  Sub_Item_Type_Field_Option_Values varchar(5000),
  Bar_Code_No varchar(20),
  Item_Name varchar(50),
  Item_Scrap_Url varchar(200),
  Item_Scrap_Type varchar(50),
  Item_Scrap_Image varchar(1000),
  Item_QRCode_Path varchar(200),
   Currency_Id int,
  Sub_Item_Type_Field_UOM varchar(1000),
  Designer_URL VARCHAR(200),
  User_Id int,
   out error1 varchar(50)
)
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare id int;
declare Item_id int;
declare mpn varchar(50);
declare Itemcodestring varchar(50);
declare Itemcode varchar(50);
declare Itemstring varchar(50);

set mpn= (select REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(Item_Manufacturing_Part_Number,'-', ''), ' ', ''),'_',''),'@',''),'~',''),'#',''),'%',''),'+',''),'=',''),'$',''),'&',''),'*',''));
set id=(select count(itemId) from m_item where itemTypeId=trim(Item_Type_Id) and itemSubTypeId=trim(Item_Sub_Type_Id) and  (REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(itemManufacturingPartNumber, '-', ''), ' ', ''),'_',''),'@',''),'~',''),'#',''),'%',''),'+',''),'=',''),'$',''),'&',''),'*',''))=mpn and isDeleted=0);

IF id = 0 THEN

call proc_get_item_code_genration(Item_Type_Id,@strout);
set Itemcodestring=(select @strout);
set Itemcode=(SELECT SUBSTRING_INDEX(Itemcodestring, ",", 1));
set Itemstring=(SELECT SUBSTRING_INDEX(Itemcodestring, ",", -1));

 INSERT INTO m_item(uomId,uomGroupId,valuationId,itemTypeId,itemSubTypeId,itemManageCodeId,
materialCategoryId,itemDescription,itemManufacture,itemBrand,supplierName,itemPrice,itemMinOrderQty,
itemThreshold,itemHSCode,itemURLLink,itemCoCountryofOrigin,itemManufacturingPartNumber,itemShippingCost,
itemContactDetails,itemEMail,itemWeChat,itemWhatsApp,itemOtherContactType,itemDataSheetUrl,
itemComplianceUrl,itemCADFileUrl,itemCertificationUrl,itemScrappingfromWebUrl,itemStatus,
internalItemCode,itemCodestring,subitemtypefieldOptionType,subitemtypefieldOptionValues,itemImagesUrl,
itemBarCodeNo,itemName,itemScrapUrl,itemScrapType,itemScrapImage,itemQRCodeImagePath,currencyId,subitemtypefieldUOMName,userId,designerURL) 
VALUES(trim(UOM_Id),trim(UOM_Group_Id),trim(Valuation_Id),trim(Item_Type_Id),trim(Item_Sub_Type_Id),
trim(Item_Manage_Code_Id),trim(Material_Category_Id),trim(Item_Description),
trim(Item_Manufacture),trim(Item_Brand),trim(Supplier_Name),trim(Item_Price),trim(Item_Min_Order_Qty),
trim(Item_Thres_hold),trim(item_HS_Code),trim(item_URL_Link),trim(Item_CoCountryof_Origin),
trim(Item_Manufacturing_Part_Number),trim(Item_Shipping_Cost),trim(Item_Contact_Details),trim(Item_EMail),
trim(Item_WeChat),trim(item_Whats_App),trim(Item_Other_Contact_Type),trim(Item_Data_Sheet_Url),
trim(Item_Compliance_Url),trim(item_CADFile_Url),trim(Item_Certification_Url),trim(Item_Scrapping_fromWeb_Url),
trim(Item_Status),Itemcode,Itemstring,trim(Sub_Item_Type_Field_Option_Type),trim(Sub_Item_Type_Field_Option_Values),
trim(Item_Images_Url),trim(Bar_Code_No),trim(Item_Name),trim(Item_Scrap_Url),trim(Item_Scrap_Type),
trim(Item_Scrap_Image),trim(Item_QRCode_Path),trim(Currency_Id),trim(Sub_Item_Type_Field_UOM),trim(User_Id),trim(Designer_URL)); 


set Item_id=(select (itemId) from m_item where itemTypeId=trim(Item_Type_Id) and itemSubTypeId=trim(Item_Sub_Type_Id) and  (REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(itemManufacturingPartNumber, '-', ''), ' ', ''),'_',''),'@',''),'~',''),'#',''),'%',''),'+',''),'=',''),'$',''),'&',''),'*',''))=mpn  ORDER BY itemId DESC LIMIT 1);


INSERT INTO m_item_log(itemId,uomId,uomGroupId,valuationId,itemTypeId,itemSubTypeId,itemManageCodeId,
materialCategoryId,itemDescription,itemManufacture,itemBrand,supplierName,itemPrice,itemMinOrderQty,
itemThreshold,itemHSCode,itemURLLink,itemCoCountryofOrigin,itemManufacturingPartNumber,itemShippingCost,
itemContactDetails,itemEMail,itemWeChat,itemWhatsApp,itemOtherContactType,itemDataSheetUrl,
itemComplianceUrl,itemCADFileUrl,itemCertificationUrl,itemScrappingfromWebUrl,itemStatus,internalItemCode,
subitemtypefieldOptionType,subitemtypefieldOptionValues,itemImagesUrl,
itemBarCodeNo,itemName,itemScrapUrl,itemScrapType,itemScrapImage,itemQRCodeImagePath,currencyId,subitemtypefieldUOMName,userId,userAction,designerURL) 
VALUES(Item_id,trim(UOM_Id),trim(UOM_Group_Id),trim(Valuation_Id),trim(Item_Type_Id),trim(Item_Sub_Type_Id),
trim(Item_Manage_Code_Id),trim(Material_Category_Id),trim(Item_Description),
trim(Item_Manufacture),trim(Item_Brand),trim(Supplier_Name),trim(Item_Price),trim(Item_Min_Order_Qty),
trim(Item_Thres_hold),trim(item_HS_Code),trim(item_URL_Link),trim(Item_CoCountryof_Origin),
trim(Item_Manufacturing_Part_Number),trim(Item_Shipping_Cost),trim(Item_Contact_Details),trim(Item_EMail),
trim(Item_WeChat),trim(item_Whats_App),trim(Item_Other_Contact_Type),trim(Item_Data_Sheet_Url),
trim(Item_Compliance_Url),trim(item_CADFile_Url),trim(Item_Certification_Url),trim(Item_Scrapping_fromWeb_Url),
trim(Item_Status),Itemcode,trim(Sub_Item_Type_Field_Option_Type),trim(Sub_Item_Type_Field_Option_Values)
,trim(Item_Images_Url),trim(Bar_Code_No),trim(Item_Name),trim(Item_Scrap_Url),trim(Item_Scrap_Type),
trim(Item_Scrap_Image),trim(Item_QRCode_Path),trim(Currency_Id),trim(Sub_Item_Type_Field_UOM),trim(User_Id),'insert',TRIM(Designer_URL)); 



SET error1=concat('0',',',Itemcode);
else
SET error1='1';
END IF;
end;

  COMMIT;
END */$$
DELIMITER ;

