DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare id int;
declare count int;
declare Action_Id int;
set id=(select count(ActionId) from v_actionpermission where permissionId=Trim(Permission_Id) and vendorId=Trim(Vendor_Id) and isDeleted=0);
IF id = 0 THEN
update v_vendorregistration set vendorloginId=Vendor_Login_Id,vendorloginPwd=Vendor_Login_PWD  where vendorId=TRIM(Vendor_Id);
INSERT INTO v_actionpermission(vendorId,permissionId,isView,userId) 
VALUES(Trim(Vendor_Id),Trim(Permission_Id),Trim(Is_View),Trim(User_Id));  
set Action_Id=(select (ActionId) from v_actionpermission where permissionId=Trim(Permission_Id) and vendorId=Trim(Vendor_Id) ORDER BY ActionId DESC LIMIT 1);
INSERT INTO v_actionpermission_log(ActionId,vendorId,permissionId,isView,userId,userAction) 
VALUES(Action_Id,Trim(Vendor_Id),Trim(Permission_Id),Trim(Is_View),Trim(User_Id),'insert');

set error1=0 ;
else
set count=(select count(ActionId) from v_actionpermission where permissionId=Trim(Permission_Id) and vendorId=Trim(Vendor_Id) and isView=Is_View and isDeleted=0);
if count=0 then
update v_actionpermission  set 
isView=Is_View
where permissionId=Trim(Permission_Id) and vendorId=Trim(Vendor_Id);
set error1=0 ;
else
SET error1=1;
end if;

END IF;

end;

  COMMIT;
END */$$
