/* Procedure structure for procedure `proc_m_item_Inactive_Status` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_m_item_Inactive_Status` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`leade_testing2`@`%` PROCEDURE `proc_m_item_Inactive_Status`(
    Item_Id int,
     User_Id int,
      out error1 int
    )
BEGIN
DECLARE exit handler for sqlexception
        BEGIN
        ROLLBACK;
        END;
    DECLARE exit handler for sqlwarning
        BEGIN
    ROLLBACK;
        END;
START TRANSACTION;
begin
declare Item_Status varchar(10);
set Item_Status=(select trim(itemStatus) from m_item where itemId=trim(Item_Id) and isDeleted=0);

INSERT INTO m_item_log(`itemId`,`uomId`,`uomGroupId`,`valuationId`,`itemTypeId`,`itemSubTypeId`,`itemManageCodeId`,`valuationMethodId`,`itemDescription`,`itemManufacture`,`itemBrand`
                      ,`supplierName`,`itemPrice`,`itemMinOrderQty`,`itemThreshold`,`itemHSCode`,`itemURLLink`,`itemCoCountryofOrigin`,`itemManufacturingPartNumber`,`itemShippingCost`,
                      `itemContactDetails`,`itemEMail`,`itemWeChat`,`itemWhatsApp`,`itemOtherContactType`,`itemDataSheetUrl`,`itemComplianceUrl`,`itemCADFileUrl`,`itemCertificationUrl`,
                      `itemScrappingfromWebUrl`,`itemImagesUrl`,`itemStatus`,`internalItemCode`,`userId`,`transDate`,`isApproved`,`isDeleted`,`userAction`,`isActive`,`subitemtypefieldOptionType`
                      ,`subitemtypefieldOptionValues`,`itemBarCodeNo`,`itemScrapUrl`,`itemScrapType`,`itemScrapImage`,`itemQRCodeImagePath`,`currencyId`,`subitemtypefieldUOMName`,`altUOMId`,
                      `altUOMGroupId`,`hscategoryId`,`itemQuantity`,`rackId`,`racknumberId`,`storelocationId`,`storelocationCode`,`designerURL`)

                SELECT `itemId`,`uomId`,`uomGroupId`,`valuationId`,`itemTypeId`,`itemSubTypeId`,`itemManageCodeId`,`valuationMethodId`,`itemDescription`,`itemManufacture`,`itemBrand`
                      ,`supplierName`,`itemPrice`,`itemMinOrderQty`,`itemThreshold`,`itemHSCode`,`itemURLLink`,`itemCoCountryofOrigin`,`itemManufacturingPartNumber`,`itemShippingCost`,
                      `itemContactDetails`,`itemEMail`,`itemWeChat`,`itemWhatsApp`,`itemOtherContactType`,`itemDataSheetUrl`,`itemComplianceUrl`,`itemCADFileUrl`,`itemCertificationUrl`,
                      `itemScrappingfromWebUrl`,`itemImagesUrl`,`itemStatus`,`internalItemCode`,`userId`,`transDate`,`isApproved`,`isDeleted`,'Activation',`isActive`,`subitemtypefieldOptionType`
                      ,`subitemtypefieldOptionValues`,`itemBarCodeNo`,`itemScrapUrl`,`itemScrapType`,`itemScrapImage`,`itemQRCodeImagePath`,`currencyId`,`subitemtypefieldUOMName`,`altUOMId`,
                      `altUOMGroupId`,`hscategoryId`,`itemQuantity`,`rackId`,`racknumberId`,`storelocationId`,`storelocationCode`,`designerURL`
                      FROM m_item WHERE itemId=TRIM(Item_Id);


IF Item_Status = 'Active' THEN
update m_item set itemStatus='Inactive',isActive=1,statuschangeDate=now(),statuschangeUsetId=trim(User_Id)  where itemId=trim(Item_Id);
else
update m_item set itemStatus='Active',isActive=0,statuschangeDate=now(),statuschangeUsetId=trim(User_Id)  where itemId=trim(Item_Id);
END IF;
set error1=0;

end;

  COMMIT;
END */$$
DELIMITER ;

